import logo from './logo.svg';
import './App.css';
import React, {useState} from 'react';
import EventButton from './Components'
import {createTable, basicGet} from './backend'


function App() {
  const [count, setCount] = useState(0);
  return (
    <div className="App">
      <header className="App-header">
        <button onClick={()=>setCount(count+2)}>Update counter</button>
        Count is {count}
        <input name="myInput" />
        <button onClick={()=>basicGet()}>Connect and create test table</button>
      </header>
    </div>
  );
}



export default App;
